import logo from './Nielsenlogo.jpg';
import React,{useState} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import './App.css';


function Login() {
  const [name,setName] = useState("George")
  const [greeting,setGreeting] = useState("George")

  function handleSubmit(event){
    alert("hi")
    fetch(`/policies`)
    .then(response => alert(response.json()));
  }
  return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p style={{color:"black",fontSize:"40px"}}>
            Policy Editor
          </p>
          <Form>
            <Form.Group controlId="formToken">
              <Form.Label>Vault Token</Form.Label>
              <Form.Control type="email" placeholder="Enter Token" />
            </Form.Group>
            <Button variant="primary" type="submit">
              Submit
            </Button>
          </Form>
          <p>{greeting}</p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
  );
}

export default Login;
